import React, { useState, useEffect } from "react";

const Home = () => {
    const [lakes, setLakes] = useState([]);
    useEffect(() => {
        fetch("https://jasonserverhoustonfishing.herokuapp.com/lakes")
            .then(res => res.json())
            .then(rsp => {
                setLakes;
            });
    });
    return (
        <div>
            <h1>THIS IS HOME</h1>

            <button onClick={() => fetchlakes()}>Call for Lakes</button>
        </div>
    );
};
export default Home;
